import { NavLink } from 'react-router-dom';

function Header() {
  return (
    <header style={styles.header}>
      <h2 style={styles.logo}>âš¡ Phone Catalog</h2>

      <nav style={styles.nav}>
        <NavLink to="/" style={styles.link}>Home</NavLink>
        <NavLink to="/catalog" style={styles.link}>Catalog</NavLink>
        <NavLink to="/cart" style={styles.link}>Cart</NavLink>
        <NavLink to="/favorites" style={styles.link}>Favorites</NavLink>
      </nav>
    </header>
  );
}

const styles = {
  header: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '16px 24px',
    borderBottom: '1px solid #333',
  },
  logo: {
    margin: 0,
  },
  nav: {
    display: 'flex',
    gap: '16px',
  },
  link: {
    textDecoration: 'none',
    color: '#000',
    fontWeight: '500',
  },
};

export default Header;
